export class VoyagerUniformPack extends BaseTngEraUniformPack implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor) + VoyagerUniforms.averageMale, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor) + VoyagerUniforms.averageFemale, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getUniformAndVariantBody(token: Token) {
        if (token.bodyType === BodyType.AverageMale) {
            return this.getNeck(token.bodyType, token.skinColor, token.species)
                + VoyagerUniforms.averageMale.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else {
            return this.getNeck(token.bodyType, token.skinColor, token.species)
                + VoyagerUniforms.averageFemale.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        }
    }
}